  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;The goals of this project are to
  1) develop modular power design concepts for human exploration flight vehicles (longer-term)
  and assess, develop,&amp;nbsp;and/or improve power system designs&amp;nbsp;for AES/HEOMD
  ground/flight demonstrations (nearer-term) ; 2) demonstrate the modular power design
  concepts, by participating in annual ground demonstrations, infusing power technologies
  developed by the Space Technology Program Game Changing Development (GCD) Space
  Power Systems (SPS) project,&amp;nbsp;Small Business Innovative Research (SBIR),
  and other government agencies as practicable; and 3) demonstrate and verify the
  operation of the modular power systems in a relevant, end-to-end ground test environment.
  The AMPs project will pursue rapid hardware development cycles for such exploration
  systems. Also, the AMPs project will determine a family of common power modules,
  delivering at least one system each year and repeating the requirements, design,
  build, test, learn process each year.&lt;/p&gt;\",\n\t\"license_title\": \"U.S.
